import React from 'react';
import DashboardCards from '../components/UserDashboardCards';

const UserDashboard = () => (
  <div>
    <h2 className="text-2xl font-bold mb-4">Overview</h2>
    <DashboardCards />
  </div>
);

export default UserDashboard;
